import api from './api';

export const authService = {
  // User login
  login: (credentials) => api.post('/auth/login', credentials),

  // Refresh token
  refreshToken: (token) => api.post('/auth/refresh', { token }),

  // Validate token
  validateToken: () => api.get('/auth/validate')
};
